export const trash = ['30, 30', `
<defs>
    <style>
      .trasha,
      .trashb {
        fill: none;
      }

      .trashb {
        stroke: #8e8e8e;
        stroke-linecap: round;
        stroke-miterlimit: 10;
        stroke-width: 1.5px;
      }
    </style>
  </defs>
  <rect class="trasha" width="19.5" height="19.5" rx="3" transform="translate(0 0)" />
  <g transform="translate(3.129 2.564)">
    <path class="trashb" d="M1811.731,2098.679l1.335,11.039a1.6,1.6,0,0,0,1.585,1.4h5.63a1.6,1.6,0,0,0,1.585-1.4l1.335-11.039" transform="translate(-1810.738 -2096.703)" />
    <line class="trashb" x2="13.457" transform="translate(0 1.884)" />
    <path class="trashb" d="M1819.878,2095.585v-1.14a.651.651,0,0,1,.651-.651h3.576a.652.652,0,0,1,.652.651v1.14" transform="translate(-1815.589 -2093.794)" />
    <line class="trashb" y2="7.398" transform="translate(6.729 4.299)" />
    <line class="trashb" y2="5.391" transform="translate(8.748 5.302)" />
    <line class="trashb" y2="5.391" transform="translate(4.709 5.302)" />
  </g>
  `]
